import styles from "./UsersList.module.css";

export default function UsersList(props){
    return(
        <ul className={styles.users}>
            {
                props.usersList.map((user,key)=>{

                        <li key={key}>{user['Username']}</li>
                })
            }
        </ul>

    )
}
